import React from "react";
import styles from "./Home.module.css";
import Product from "./Product";
import { Component } from "react";
import { Link } from "react-router-dom";

function Home(props) {
  return (
    <div>
      <p className={styles.category}>Category Name</p>
      <div className={styles.home}>
        <div className={styles.home__container}>
          <div className={styles.home__row}>
            <Link to="/productPage" style={{ marginRight: "300px" }}>
              <Product
                image="https://images-na.ssl-images-amazon.com/images/I/71Swqqe7XAL._AC_SX466_.jpg"
                tittle={arr.title}
                price={29.99}
              />
            </Link>
            <Link to="/productPage">
              <Product
                tittle="Amazon Echo (3rd generation) | Smart speaker with Alexa, Charcoal Fabric"
                price={29.99}
                image="https://media.very.co.uk/i/very/P6LTG_SQ1_0000000071_CHARCOAL_SLf?$300x400_retinamobilex2$"
              />
            </Link>
            <Link to="/productPage">
              <Product
                tittle="New Apple iPad Pro (12.9-inch, Wi-Fi, 128GB) - Silver (4th Generation)"
                price={29.99}
                image="https://images-na.ssl-images-amazon.com/images/I/816ctt5WV5L._AC_SX385_.jpg"
              />
            </Link>
          </div>

          <div className={styles.home__row}>
            <Product
              image="https://images-na.ssl-images-amazon.com/images/I/71Swqqe7XAL._AC_SX466_.jpg"
              tittle="Samsung LC49RG90SSUXEN 49' Curved LED Gaming Monitor"
              price={29.99}
            />
            <Product
              tittle="Amazon Echo (3rd generation) | Smart speaker with Alexa, Charcoal Fabric"
              price={29.99}
              image="https://media.very.co.uk/i/very/P6LTG_SQ1_0000000071_CHARCOAL_SLf?$300x400_retinamobilex2$"
            />
            <Product
              tittle="New Apple iPad Pro (12.9-inch, Wi-Fi, 128GB) - Silver (4th Generation)"
              price={29.99}
              image="https://images-na.ssl-images-amazon.com/images/I/816ctt5WV5L._AC_SX385_.jpg"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
